    if (numInput && numInput < 0) {
      setValue(0);
    }
  }
  return (
    <input
        id={props.field_id}
        placeholder={props.placeholder_text}
        type="number"
        value={numInput ? numInput : ""}
        onChange={checkIfNegative}
    />
  )
}

